import React from 'react';
import  './footer.css'

const Footer = () => {
    return ( 
        <>
            <div className="container-fluid footer-top">
                <div className="row footer-top-row">
                    <div className="col-7">
                        <img src="" alt="" />
                    </div>
                    <div className="col-3"></div>
                    <div className="col-2"></div>
                </div>
            </div>
        </>
     );
}
 
export default Footer;
